import React from "react";
import { Card } from "../../Card.styled";
import { CardList } from "../../CardList.styled";
import { CardLink } from "../../Link.styled";

const Footer = ({ styles }) => {
  return (
    <footer>
      <Card
        pd={"1rem"}
        dp={"grid"}
        gridC={"40% 20% 20% 20%"}
        height={"10rem"}
        bd={"1px solid red"}
        mg={"0rem 2rem"}
      >
        <Card bd={"1px solid blue"}>
          <Card>
            <b>A.</b>
          </Card>
          <Card lh={"0.8rem"} fs={"0.5rem"} mg={"1rem 6rem 0rem 0rem"}>
            The best NFTs marketplace website in the world and feel your
            experience in selling or buying our work
          </Card>
        </Card>
        <Card dp={"grid"} gridR={"20% 20% 20% 20% 20%"} bd={"1px solid blue"}>
          <CardList fs={"0.8rem"} ltype={"none"}>
            About
          </CardList>
          <CardList cl={styles.colors.textAlt} fs={"0.5rem"} ltype={"none"}>
            Product
          </CardList>
          <CardList cl={styles.colors.textAlt} fs={"0.5rem"} ltype={"none"}>
            Resources
          </CardList>
          <CardList cl={styles.colors.textAlt} fs={"0.5rem"} ltype={"none"}>
            Terms & Conditions
          </CardList>
          <CardList cl={styles.colors.textAlt} fs={"0.5rem"} ltype={"none"}>
            FAQ
          </CardList>
        </Card>
        <Card bd={"1px solid blue"}></Card>
        <Card bd={"1px solid blue"}></Card>
      </Card>
    </footer>
  );
};

export default Footer;
